import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "@openzeppelin/contracts/access/Ownable.sol";
import "./HasAdmin.sol";

contract Chainbox is
    ERC721,
    Ownable,
    HasAdmin
{

    uint256 public constant maxSupply = 100;
    uint256 public mintPrice = 0.5 ether;

    uint32 public totalSupply = 0;

    string public baseTokenURI;

    event Mint(uint256 indexed tokenId, address indexed minter);

    constructor(string memory _baseTokenURI, address owner, address admin , uint256 _mintPrice)
        ERC721("Chainbox", "ChainboxABI")
    {
        baseTokenURI = _baseTokenURI;

        transferOwnership(owner);
        _setAdmin(admin);

        mintPrice = _mintPrice;
    }

    modifier onlyAdminOrOwner() {
        require(
            _isAdmin(_msgSender()) || owner() == _msgSender(),
            "Only owner or admin can set daily aging rate"
        );
        _;
    }

    function changeAdmin(address newAdmin) external onlyOwner {
        _setAdmin(newAdmin);
    }

    function _baseURI() internal view virtual override returns (string memory) {
        return baseTokenURI;
    }

    function setBaseURI(string memory baseURI) public onlyOwner {
        baseTokenURI = baseURI;
    }

}
